import React from 'react';
import { Text, StyleSheet } from 'react-native';

function TopRatingScreen(props) {
    return (
        <Text style={styles.judul}>Top Rating Novels</Text>
    );
}

const styles = StyleSheet.create({
    judul : {
        top: 50,
        left: 50,
        fontSize: 40
    },
})

export default TopRatingScreen;
